import React,{Component} from 'react';

export class Cadastro extends Component{
  constructor(props) {
    super(props);
  }

  render(){
    return (
      <div>
        <h4>
          pagina de cadastro
        </h4>

  <form>
    <label>
      Nome:
      <input type="text" name="name" />
    </label>
    <input type="submit" value="Enviar" />
  </form>
      </div>
    )
  }

}
